import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Signup from './pages/Signup.js';
import { AuthenticationProvider } from './AuthenticationContext';
import { useContext } from 'react'; 

function App() {
  const { setUserAndAuthenticate } = useContext(AuthenticationContext);

  return (
    <Router>
      <AuthenticationProvider>
        <Routes> 
          <Route 
            path="/signup" 
            element={<Signup setUserAndAuthenticate={setUserAndAuthenticate} />} // Pass setUserAndAuthenticate as prop
          /> 
        </Routes>
      </AuthenticationProvider>
    </Router>
  );
}

export default App;
